				var buttonEndY = self.button.y;
				self.button.alpha = 1;
				self.button.x = buttonStart;
				moveImageIn(self.button, {x: buttonMid}, 500, createjs.Ease.sineIn).to({x: buttonEnd}, 1000, createjs.Ease.elasticOut);
		
				moveImageIn(self.headline, {alpha: 1}, 500, createjs.Ease.sineOut, 500).call(function(){
					self.writeOn.alpha = 1;
					self.writeOn.play();
					delayedAction(function(){pulsateButton(0);}, 1500);
					});
				delayedAction(doBanner, 9000);
